import React from 'react';

const BinarySearchInformation = () => {
    return (
        <div className="information">
            <h1>Binary Search</h1>
            <p>Binary Search is an algorithm to search for a value in an array or any other linear data structure. Binary Search is only possible if the array is already in a sorted order. The search starts at the midpoint of the array, and compares it with the target value. If it is less than the target value, the search continues only in the right half of the array. If it is greater than the target value, the search continues only in the left half of the array. If it is equal, the search ends and we have found our target value.</p>
            <br />
            <p>Binary Search relies on the fact that the array is already sorted beforehand. Because of this it is able to eliminate half of the entries remaining with every comparison, because all values after a certain value are greater than or equal to that value, and all values before a certain value are less than or equal to that value.</p>
            <br />
            <p>In the worst-case, Linear Search must compare the target value with every value in the array. Thus, an array with n elements will have a time complexity of O(n) for Linear Search. The space complexity of linear search is constant because no extra space is required.</p>
            <br />
            <table>
                <tbody>
                    <tr><th>Binary Search</th><th>Complexity</th></tr>
                    <tr><td>Time Complexity</td><td>O(log n)</td></tr>
                    <tr><td>Space Complexity</td><td>O(1)</td></tr>
                </tbody>
            </table>
        </div>
    );
}

export default BinarySearchInformation;
